import React, { useState, useEffect } from 'react';
import {
  Timeline,
  TimelineItem,
  TimelineSeparator,
  TimelineConnector,
  TimelineContent,
  TimelineOppositeContent,
} from '@mui/lab';
import Typography from '@mui/material/Typography';

import untitled from './image/Untitled.png';
import MosGames from './image/Mo\'s Games logo.png';
import mohammedGithub from './image/Mohammed_github.png';
import Nodejs from './image/node.png';
import theresidentsclub from './image/theresidentsclub.png';
import clearear from './image/Clearear.jpg';
import Javascript from './image/javascript.png';
import react from './image/React.png';
import Python from './image/python.png';
import SQL from './image/sql-logo.png';
import kotlin from './image/kotlin.png';
import selenium from './image/Selenium.png';
import renuem from './image/Renuem.png';

const MainContent = () => {
  const [isMobileView, setIsMobileView] = useState(false);
  const [tooltipVisible, setTooltipVisible] = useState({});

  // State to control alternating side of timeline
  const [alternate, setAlternate] = useState(true);

  useEffect(() => {
    const updateView = () => setIsMobileView(window.innerWidth <= 1050);
    updateView();
    window.addEventListener('resize', updateView);
    return () => window.removeEventListener('resize', updateView);
  }, []);

  const handleLogoHover = (id) => {
    setTooltipVisible({ ...tooltipVisible, [id]: true });
  };

  const handleLogoLeave = (id) => {
    setTooltipVisible({ ...tooltipVisible, [id]: false });
  };

  const styles = {
    main: {
      paddingLeft: '300px',
      paddingRight: '300px',
      background: 'linear-gradient(to bottom, #253041, #2a2858)',
      color: '#C9D1D9',
      minHeight: '100vh',
      fontFamily: "'Roboto', sans-serif",
      boxSizing: 'border-box',
    },
    heroSection: {
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      gap: '2rem',
      flexDirection: isMobileView ? 'column' : 'row',
      marginTop: '6rem',
      padding: '0 2rem',
    },
    image: {
      width: isMobileView ? '50%' : '15%',
      borderRadius: '5%',
    },
    paragraph: {
      fontSize: isMobileView ? '18px' : '20px',
      textAlign: 'left',
      lineHeight: '1.8',
      marginTop: '50px',
      maxWidth: isMobileView ? '95%' : '50%',
    },
    sectionHeader: {
      textAlign: 'center',
      margin: '4rem 0 2rem',
      color: '#aaa',
      fontWeight: 'normal',
      fontSize: isMobileView ? '1.2rem' : '1.5rem',
    },
    logoContainer: {
      display: 'flex',
      justifyContent: 'space-evenly',
      gap: '2rem',
      margin: '2rem 0',
    },
    logo: {
      width: isMobileView ? '30px' : '50px',
      filter: 'grayscale(100%)',
      transition: 'filter 0.3s ease-in-out',
    },
    tooltip: {
      position: 'absolute',
      backgroundColor: '#555',
      color: '#fff',
      padding: '5px 10px',
      borderRadius: '6px',
      fontSize: '12px',
      bottom: '130%',
      left: '50%',
      transform: 'translateX(-50%)',
      whiteSpace: 'nowrap',
      zIndex: '1',
      visibility: 'hidden',
      opacity: 0,
      transition: 'opacity 0.2s ease-in-out',
    },
    tooltipVisible: {
      visibility: 'visible',
      opacity: 1,
    },
    ul: {
      listStyleType: 'disc',
      marginLeft: '20px',
      lineHeight: '1.8',
      padding: 0,
    },
    li: {
      marginBottom: '10px',
    },
    timelineItem: {
      display: 'flex',
      flexDirection: alternate ? 'row' : 'row-reverse', // Alternate direction
      marginBottom: '1.5rem',
    },
    timelineContent: {
      flex: 1,
    },
    timelineOppositeContent: {
      flex: 1,
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
    },
  };

  const techLanguages = [
    { id: 'javascript', src: Javascript, name: 'Javascript' },
    { id: 'react', src: react, name: 'React.js' },
    { id: 'Node.js', src: Nodejs, name: 'Node.js' },
    { id: 'python', src: Python, name: 'Python' },
    { id: 'SQL', src: SQL, name: 'SQL' },
    { id: 'kotlin', src: kotlin, name: 'Kotlin' },
    { id: 'selenium', src: selenium, name: 'Selenium' },
  ];

  const workHistory = [
    {
      id: '2024-present',
      icon: renuem,
      title: 'üåç Renuem',
      description: (
        <>
          <p>Renewable energy investment platform.</p>
          <ul style={styles.ul}>
            <li style={styles.li}>
              Developed a renewable energy investment app using React Native (Expo) and Node.js with Express.js, enabling individuals to invest in wind farms and solar panels through a scalable and secure platform.
            </li>
            <li style={styles.li}>
              Deployed the backend on AWS, integrating MySQL RDS for efficient data management and real-time investment tracking.
            </li>
            <li style={styles.li}>
              Collaborated with stakeholders to align the app with business goals, driving user engagement and satisfaction.
            </li>
          </ul>
        </>
      ),
    },
    {
      id: '2024',
      icon: clearear,
      title: 'üíº Clear Ear',
      description: (
        <>
          <p>Hearing clinic appointment management app.</p>
          <ul style={styles.ul}>
            <li style={styles.li}>
              Designed and developed an Android app using React Native to manage patient appointments and streamline operations for a hearing clinic.
            </li>
            <li style={styles.li}>
              Integrated a local database with AsyncStorage to store and track customer details and appointment history.
            </li>
            <li style={styles.li}>
              Worked closely with clinic staff to gather requirements and ensure the app met operational needs and improved workflow efficiency.
            </li>
          </ul>
        </>
      ),
    },
    {
      id: '2020-2023',
      icon: MosGames,
      title: 'üéÆ Mo‚Äôs Pvt',
      description: (
        <>
          <p>Data analysis and digital development.</p>
          <ul style={styles.ul}>
            <li style={styles.li}>
              Conducted data analysis for the launch of bubble tea in Pakistan, identifying key demographics and customer segments for targeted marketing.
            </li>
            <li style={styles.li}>
              Analyzed market trends to assess the possibility of expanding into new locations for bubble tea and nitrogen ice cream shops.
            </li>
            <li style={styles.li}>
              Developed and maintained the Mo‚Äôs Games website using HTML, CSS, and JavaScript, improving customer engagement and online presence.
            </li>
            <li style={styles.li}>
              Utilized data insights to optimize marketing strategies, driving successful product launches and business growth.
            </li>
          </ul>
        </>
      ),
    },
  ];

  return (
    <div style={styles.main}>
      <div style={styles.heroSection}>
        <img src={untitled} alt="Mohammed" style={styles.image} />
        <div style={styles.paragraph}>
          <p>
            With over 7 years of experience as a Full Stack Developer and Data Analyst, I‚Äôve built my career
            around designing efficient, user-focused solutions that bridge technical innovation with real-world impact.
            My expertise spans front-end and back-end development, leveraging tools like React Native, Node.js, and
            database management to create scalable applications for startups and enterprises.
          </p>
          <p>
            I‚Äôve also been fortunate to combine my technical skills with entrepreneurial insight. For instance, I played
            a key role in launching innovative ventures, such as introducing fruit bubble tea to the Pakistani market while
            managing a dynamic gaming lounge in Lahore. This experience sharpened my ability to analyze market trends, lead
            teams, and deliver customer-centric solutions.
          </p>
          <p>
            Outside of work, I‚Äôm always exploring the latest in technology, tackling coding challenges, and developing
            products that make a difference.
          </p>
        </div>
      </div>

      <h3 style={styles.sectionHeader}>Skills & Technologies</h3>
      <div style={styles.logoContainer}>
        {techLanguages.map(({ id, src, name }) => (
          <div key={id} style={{ position: 'relative' }}>
            <img
              src={src}
              alt={name}
              style={styles.logo}
              onMouseEnter={() => handleLogoHover(id)}
              onMouseLeave={() => handleLogoLeave(id)}
            />
            {tooltipVisible[id] && (
              <div style={{ ...styles.tooltip, ...styles.tooltipVisible }}>{name}</div>
            )}
          </div>
        ))}
      </div>

      <h3 style={styles.sectionHeader}>Work History</h3>
      <Timeline>
        {workHistory.map(({ id, icon, title, description }) => (
          <TimelineItem key={id} style={styles.timelineItem}>
            <TimelineOppositeContent style={styles.timelineOppositeContent}>
              <img src={icon} alt={title} style={styles.image} />
            </TimelineOppositeContent>
            <TimelineSeparator>
              <TimelineConnector />
            </TimelineSeparator>
            <TimelineContent style={styles.timelineContent}>
              <Typography variant="h6" component="div" style={{ fontWeight: 'bold' }}>
                {title}
              </Typography>
              {description}
            </TimelineContent>
          </TimelineItem>
        ))}
      </Timeline>
    </div>
  );
};

export default MainContent;
